Een portret van Lady Diana, prinses van Wales. We volgen Diana tijdens haar laatste twee levensjaren en zien hoe zij langzaam het ware geluk vindt en persoonlijke successen behaalt. Diana groeit uit tot een belangrijke internationale campagnevoerder en zij strijdt voor de rechten van de mens. Maar dan ontmoet zij Dr. Hasnat Kahn met wie ze een geheime affaire begint....
******************************************
During the last two years of her life, Princess Diana embarks on a final rite of passage: a secret love affair with Pakistani heart surgeon Hasnat Khan. 

